import React from "react";
import Navigation from "../../Navigation/Navigation";

const MONTHS = [
    {
        id: '1',
        name: 'January',
        year: '2021',
        budget: '500',
        balance: '200',
    },
    {
        id: '2',
        name: 'February',
        year: '2021',
        budget: '700',
        balance: '300',
    },
    {
        id: '3',
        name: 'March',
        year: '2021',
        budget: '800',
        balance: '150',
    }];

const Yearly = () => {

    const monthsList = MONTHS.map(month => <li>{month.name}</li>);
    const monthsYear = MONTHS.map(month => <li>{month.year}</li>);
    const monthsBudget = MONTHS.map(month => <li>{month.budget}</li>);


    return (
        <div>
            <Navigation></Navigation>
            <h1>Yearly balance</h1>
            <div className="box">
                <h1>{monthsList}</h1>
                <h3>{monthsYear}</h3>
                <h3>{monthsBudget}</h3>
            </div>
        </div>
    )
}

export default Yearly;
